const _hoisted_15 = /* @__PURE__ */ createStaticVNode('<h2 id="best-practices" tabindex="-1">Best practices <a class="header-anchor" href="#best-practices" aria-label="Permalink to &quot;Best practices&quot;">​</a></h2><p>Banners should:</p><ul><li>Be used thoughtfully and sparingly for only the most important information.</li><li>Not be used to call attention to what a merchant needs to do in the UI instead of making the action clear in the UI itself.</li><li>Not be the primary entry point to information or actions merchants need on a regular basis.</li><li>Be dismissible unless they contain critical information or an important step merchants need to take.</li><li>Use the default icon for <code>success</code>, <code>info</code>, <code>warning</code> and <code>critical</code> tones. If the status icon is changed, use only <a href="https://polaris.shopify.com/design/icons#major-icons-20-20" target="_blank" rel="noreferrer">major icons</a>.</li><li>Remove the status icon only in scenarios where it takes up too much space, such as very small breakpoints or in side navigation cards.</li></ul><h3 id="placement" tabindex="-1">Placement <a class="header-anchor" href="#placement" aria-label="Permalink to &quot;Placement&quot;">​</a></h3><p>Banners should be placed in the appropriate context:</p><ul><li>Banners relevant to an entire page should be placed at the top of that page, below the page header. They should occupy the full width of the content area.</li><li>Banners related to a section of a page (like a card, popover, or modal) should be placed inside that section, below any section heading. These banners have less spacing and a pared-back design to fit within a content context.</li><li>Banners related to an element more specific that a section should be placed immediately above or below that element.</li></ul><hr><h2 id="content-guidelines" tabindex="-1">Content guidelines <a class="header-anchor" href="#content-guidelines" aria-label="Permalink to &quot;Content guidelines&quot;">​</a></h2><p>Banners should:</p><ul><li>Focus on a single theme, piece of information, or required action to avoid overwhelming merchants.</li><li>Be concise and scannable—merchants shouldn’t need to spend a lot of time figuring out what they need to know and do.</li><li>Be limited to a few important calls to action with no more than one primary action.</li><li>Not be used for marketing information or upsell—<a href="/polaris-vue/components/CalloutCard">use callout cards</a> instead.</li></ul><p>To learn about writing helpful and accessible error message text, see the guidelines for <a href="https://polaris.shopify.com/patterns/error-messages" target="_blank" rel="noreferrer">error messages</a>.</p><h3 id="title" tabindex="-1">Title <a class="header-anchor" href="#title" aria-label="Permalink to &quot;Title&quot;">​</a></h3><p>Banner titles should follow the content guidelines for <a href="https://polaris.shopify.com/content/actionable-language#headings-and-subheadings" target="_blank" rel="noreferrer">headings and subheadings</a>.</p><h3 id="body-content" tabindex="-1">Body content <a class="header-anchor" href="#body-content" aria-label="Permalink to &quot;Body content&quot;">​</a></h3><p>Body content should:</p><ul><li>Be concise: keep content to 1 to 2 sentences where possible</li><li>Clarify the benefit of the main task</li><li>Be written in sentence case and use appropriate punctuation</li><li>Avoid repeating the heading</li><li>Explain how to resolve the issue, particularly for warning and critical banners</li></ul>', 16);
