const _hoisted_75 = /* @__PURE__ */ createStaticVNode('<hr><h2 id="related-components" tabindex="-1">Related components <a class="header-anchor" href="#related-components" aria-label="Permalink to &quot;Related components&quot;">​</a></h2><ul><li>To inform merchants about a new feature or opportunity, <a href="/polaris-vue/components/CalloutCard">use callout cards</a></li><li>To group similar concepts together in the interface, <a href="/polaris-vue/components/Card">use a card</a></li></ul><hr><h2 id="accessibility" tabindex="-1">Accessibility <a class="header-anchor" href="#accessibility" aria-label="Permalink to &quot;Accessibility&quot;">​</a></h2><p>Banners provide context and assist workflows for merchants with disabilities.</p><ul><li>Critical and warning banners have a <code>role=”alert”</code> and are announced by assistive technologies when they appear.</li><li>All other banners have a <code>role=”status”</code> and are read after any critical announcements.</li><li>All banners have an <code>aria-live</code> attribute and are announced by assistive technologies when their content is updated. These announcements can be disabled by using the prop <code>stopAnnouncements</code>.</li><li>Banners use <code>aria-describedby</code> to describe their purpose to assistive technologies when they’re announced or receive focus. If a banner has a <code>title</code>, then the title content is used for the <code>aria-describedby</code>. If the banner doesn’t have a <code>title</code>, then all of the banner content is used for the <code>aria-describedby</code>.</li><li>Banner containers have a <code>tabindex=”0”</code> and display a visible keyboard focus indicator. Because of this, merchants can discover banners while tabbing through forms or other interactions, and developers can programmatically move focus to banners.</li><li>Banners use a combination of <a href="https://polaris.shopify.com/design/icons" target="_blank" rel="noreferrer">icons</a> and <a href="https://polaris.shopify.com/design/colors" target="_blank" rel="noreferrer">colors</a> to show their meaning and level of importance to merchants.</li></ul><h3 id="error-notifications-in-forms" tabindex="-1">Error notifications in forms <a class="header-anchor" href="#error-notifications-in-forms" aria-label="Permalink to &quot;Error notifications in forms&quot;">​</a></h3><h4 id="critical-banners" tabindex="-1">Critical banners <a class="header-anchor" href="#critical-banners" aria-label="Permalink to &quot;Critical banners&quot;">​</a></h4><p>When merchants submit long or complex forms with errors, use a critical banner to summarize what went wrong. Place the banner at the top of the form and move focus to the banner when the form is submitted. This allows all merchants to move through the form in a logical order to correct the issues.</p><h4 id="inline-errors" tabindex="-1">Inline errors <a class="header-anchor" href="#inline-errors" aria-label="Permalink to &quot;Inline errors&quot;">​</a></h4><p>Always include <a href="/polaris-vue/components/InlineError">inline error</a> messages for specific form fields so that merchants know what to do in context as they correct their mistakes.</p><p>To learn about creating helpful and accessible error message text, see the guidelines for <a href="https://polaris.shopify.com/patterns/error-messages" target="_blank" rel="noreferrer">error messages</a>.</p>', 13);
